import { React } from "react";

import "./cart-item.styles.scss";

const CartItem = (item) => {
  <div className="cart-item">
    <img className="img" src="item.url" alt="" />
    <div className="item-details">
      <h2>item.name</h2>
      <span>
        {item.quantity}x${item.price}
      </span>
    </div>
  </div>;
};

export default CartItem;
